(32, 'Despre noi', '<p>OrÄÈelul cu aceastÄ denumire e menÈionat documentar ca sat la 20 martie 1545, c&acirc;nd Alexandru Voievod, domnul Moldovei, confirmÄ mÄnÄstirii Pobrata o jumÄtate de moÈie pe care cÄlugÄrii o aveau &icirc;n dar de la jup&acirc;neasa FrÄÈiman cu satul Curluceni. La 4 iulie 1774 &icirc;l aflÄm &icirc;n stÄp&acirc;nirea mÄnÄstirii Frumoasa, cu 84 de gospodÄrii cu rÄzeÈi Èi mazili. OraÈul avea 2 preoÈi, biserica a fost construitÄ &icirc;n anul 1785, alÄturi de alta veche. Sat mare Èi frumos, &icirc;n anul 1870 aici erau 596 gospodÄrii, 1840 bÄrbaÈi Èi 1110 femei. Gospodarii Èineau prisÄci, vii Èi livezi frumoase, erau lemnari, t&acirc;mplari vestiÈi. La 6 ianuarie 1873 zemstva judeÈeanÄ trimite la StrÄÈeni primul medic cu studii superioare, pe doctorul Feodor Constantinovichi Scordeli. La 1 iulie 1877 satul avea o bibliotecÄ sÄteascÄ, uar &icirc;n anul 1910 avea 2 Ècoli Èi o bisericÄ.</p>\n\n<p>Din spusele celui mai bÄtr&acirc;n locuitor din oraÈ I. Èurcanu &icirc;n v&acirc;rstÄ de 98 de ani, care a auzit din mÄrturisirile</p>\n\n<p><img src="http://localhost/apps/frontend/views/templates/Default/assets/img/logo.png" style="margin:15px 0px 35px" /></p>\n\n<p>Din spusele celui mai bÄtr&acirc;n locuitor din oraÈ I. Èurcanu &icirc;n v&acirc;rstÄ de 98 de ani, care a auzit din mÄrturisirile bunicului sÄu, cÄ undeva pe dealul CoÈnei, un oarecare Teofan, strÄger, a construit o casÄ &icirc;n care stÄteau strÄgerii ce vegheau ChiÈinÄul. Cu toÈi strÄgerii conducea &icirc;nsÄÈi Teofan. OdatÄ cu apariÈia localitÄÈii, de la cuv&acirc;ntul strÄgeri s-a tras toponimul StrÄÈeni.</p>\n\n<p>Localitatea, &icirc;ncep&acirc;nd cu a doua jumÄtate a sec. XX, s-a dezvoltat intens, devenind un centru industrial important din republicÄ.</p>\n\n<p>&Icirc;n oraÈul StrÄÈeni sunt &icirc;nregistraÈi circa 2780 agenÈi economici, dintre care cel mai mare numÄr &icirc;l constituie gospodÄriile ÈÄrÄneÈti &ndash; 1.590. &Icirc;ntreprinderile cu dreptul de persoane juridice alcÄtuiesc 305 unitÄÈi. Un loc de frunte ocupÄ industria alimentarÄ, mai ales cea vinicolÄ. StrÄÈeniul se bucurÄ de un spectru bogat al celor mai bune soiuri de poamÄ europeanÄ: Aligote, Pinot, Cabernet, Izabelle, Risling de Italia, coniacuri, din care se obÈine Èampanie, vinuri seci ordinare Èi dulci de calitate superioarÄ Èi sucuri naturale. Partea industrialÄ a oraÈului este amplasatÄ &icirc;n regiunea de nord-vest a oraÈului Èi este despÄrÈitÄ de sectorul locativ prin calea feratÄ. Punctul de vinificaÈie, secÈia de cÄrÄmidÄ a fabricii de materiale de construcÈie se aflÄ &icirc;n partea de nord a oraÈului. &Icirc;n domeniul comerÈului activeazÄ 96 &icirc;ntreprinderi, sistemul de alimentaÈie publicÄ este format de 25 &icirc;ntreprinderi. Deservirea socialÄ este asiguratÄ de 17 unitÄÈi de deservire.</p>\n\n<p>&Icirc;n oraÈ activeazÄ filiale ale 3 bÄnci comerciale Èi ale 2 companii de asigurare.</p>\n\n<p>Este dezvoltatÄ producÈia de vinuri: . Se produc conserve din fructe Èi legume Èi produse de panificaÈie. Fabrica materialelor de construcÈie produce ÈiglÄ roÈie, faianÈÄ. La 6 km spre sud-vest funcÈioneazÄ antena TV de l&acirc;ngÄ StrÄÈeni.</p>\n', 'Despre-noi', 26, 1, 1),
