(82, 'Planuri de acÈiune', '<h2>Planurile de acÅ£iune pentru reducerea zgomotului &icirc;n raionul StrÄÈeni</h2>\n\n<p>Planurile de acÅ£iune au fost elaborate pe baza rezultatelor conÅ£inute de hÄrÅ£ile strategice de zgomot, &icirc;n vederea prevenirii Åi reducerii zgomotului Åi a efectelor acestuia, mai cu seamÄ acolo unde valorile nivelurilor de zgomot depÄÅesc limitele admise.</p>\n\n<p>DupÄ elaborarea hÄrÅ£ilor de zgomot s-a constatat cÄ circulaÅ£ia rutierÄ are cea mai mare pondere &icirc;n producerea zgomotului, de aceea Åi planul de acÅ£iune se referÄ &icirc;n primul r&acirc;nd la zgomotul produs de traficul rutier.</p>\n\n<p>Planurile de dezvoltare ale oraÅului care cuprind planurile de &icirc;mbunÄtÄÅ£ire a circulaÅ£iei, de protecÅ£ia mediului, de urbanism, vor cuprinde Åi aceste planuri de reducerea zgomotului.</p>\n\n<p>HÄrÅ£ile de zgomot Åi Planurile de acÅ£iune au fost predate, conform H.G. 321/ 2005, republicatÄ, privind evaluarea Åi gestionarea zgomotului ambiant, iar &icirc;n concordanÅ£Ä cu art.4, aliniat 9, acestea vor fi actualizate Åi predate AgenÅ£iei Regionale de ProtecÅ£ia Mediului, o datÄ la 5 ani, respectiv 30 iunie 2012 pentru HÄrÅ£ile de zgomot Åi 18 iulie 2013 pentru Planurile de acÅ£iune.</p>\n', 'planuri-de-actiune', 52, 1, 1),
